"Ang Pula vs. Asul ay isang mini battle game ng Minecraft. Random na ia-assign ang mga player ng mga server sa pula/asul na team sa mga PVP battle. Ang team na makakakuha ng partikular na dami ng mga kalaban ang siyang mananalo.

 Mga tuntunin at procedure:
 1. Dapat na itakda ng host ng server ang kapasidad ng server (dapat na pantay) at ang kundisyon sa pagpanalo (hal. ang dami ng mga kalabang mapapatay);
 2. Naghihintay sa ibang mga player upang sumali sa iyong server, pagkaraang mapuno, i-click ang \"magsimula\" upang magsimula;
 3. Random na hinahati sa dalawang team ang mga player sa server: Pulang Team at Asul na Team Ang mga palayaw ng bawat mga player ng team ay makikilala sa kulay na pula at asul; Papaalalahanan ka kung saang team ka kasali kapag nagsimula nang mag-count down ang laro;
 4. Kapag naglalaro, ibibilang na 1 kill ang pagpatay sa isang kalabang player; bibilanganging 1 manslaughter ang pagpatay sa isang team player; Ibibilang na 1 death kapag napatay ka ng isang kalaban / team player; Ang aksidenteng pagkamatay (hal., nahulog at namatay, napatay ng mga monster, etc.) ay bibilangin bilang 1 death;
 5. Maaaring sumaling muli sa laro ang player na bubuhayin muli sa pagtatapos ng laro o kapag may natukoy nang nanalo;
 6. Tumatagal ang bawat laro nang maximum na 25 minuto. Ang unang team na makakapatay ng partikular na dami ng mga kalaban sa loob ng 25 minuto ang siyang mananalo.
 7. Kung wala sa alinmang team ang makakakuha sa itinakdang bilang ng mga kalaban sa loob ng 25 minuto, ang team na may pinakamaraming napatay na mga kalaban ang mananalo; kung pareho ang napatay ng dalawang team, magtatapos ang laro sa draw;
 8. Kung mag-offline ang ilang mga player o umalis sa server, magpapatuloy ang laro; kung mag-offline ang lahat ng mga player ng isang team o umalis sa server, ituturing ang kabilang team bilang ang nanalo;"
